import React, { Component } from 'react'
import { dark, light } from './components/SettingsPanel';

export default class Button extends Component {


    constructor() {
       super();

       this.state = {
         clicked: false
       };

       this.handleClick = this.handleClick.bind(this);
     }

    handleClick() {
      this.setState({
        clicked: true
      });
    }

    render () {

      return (

          <div onClick={this.handleClick}>

            {this.state.clicked ? <dark /> : <light />}
          </div>
    )



    }
  }
